CREATE DEFINER=`root`@`localhost` PROCEDURE `categoriaCreate` (IN `p_nombre` VARCHAR(30), IN `p_desc` VARCHAR(256), IN `p_user` INT, OUT `p_lastid` FLOAT)  begin
    insert into Categorias(categoriaNombre, categoriaDescripcion, categoriaUsuario, categoriaFecha) 
    values (p_nombre, p_desc, p_user, current_date());
    select last_insert_id() into p_lastid;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `categoriaGetAll` ()  begin
select categoriaId, categoriaNombre, categoriaFecha, categoriaDescripcion, categoriaUsuario FROM categorias;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cursoSearch` (IN `p_abuscar` VARCHAR(100))  begin
    select cursoId, cursoNombre, cursoMiniatura, cursoDescripcion, cursoCosto, cursoNiveles, @tempval from Curso where cursoNombre like p_abuscar limit 9;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `userCreate` (IN `p_nombre` VARCHAR(60), IN `p_apellido` VARCHAR(60), IN `p_email` VARCHAR(60), IN `p_tipo` BOOL, IN `p_fechanac` DATE, IN `p_genero` INT, IN `p_contraseña` VARCHAR(2048))  begin
insert into Usuario (usuarioNombre, 
                    usuarioApellido, 
                    usuarioEmail, 
                    usuarioTipo, 
                    usuarioFechaNacimiento, 
                    usuarioGenero, 
                    usuarioContraseña,
                    usuarioFechaRegistro,
                    usuarioEstado) 
        values(    p_nombre, 
                p_apellido, 
                p_email, 
                p_tipo, 
                p_fechanac, 
                p_genero, 
                p_contraseña,
                current_date(),
                true);
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `userEmailCheck` (IN `p_email` VARCHAR(60), OUT `p_nombre` VARCHAR(60))  begin
select usuarioNombre into p_nombre from Usuario where usuarioEmail = p_email;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `userEmailExists` (IN `p_email` VARCHAR(60), OUT `p_id` INT, OUT `p_nombre` VARCHAR(60), OUT `p_apellido` VARCHAR(60), OUT `p_contraseña` VARCHAR(2048), OUT `p_tipo` BOOL, OUT `p_genero` INT, OUT `p_fechanac` DATE)  begin
select usuarioId, usuarioNombre, usuarioApellido, usuarioContraseña, usuarioTipo, usuarioGenero, usuarioFechaNacimiento 
into p_id, p_nombre, p_apellido, p_contraseña, p_tipo, p_genero, p_fechanac
from Usuario where usuarioEmail = p_email;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `userGetId` (IN `p_email` VARCHAR(60), OUT `p_id` INT)  begin
select usuarioId into p_id from usuario where usuarioEmail = p_email;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `userUpdate` (IN `p_id` INT, IN `p_nombre` VARCHAR(60), IN `p_apellido` VARCHAR(60), IN `p_email` VARCHAR(60), IN `p_tipo` BOOL, IN `p_fechanac` DATE, IN `p_genero` INT, IN `p_contraseña` VARCHAR(2048))  begin
set @tempcontra = p_contraseña;
select usuarioContraseña into @tempcontra from Usuario where usuarioId = p_id;
update Usuario set 
usuarioNombre = p_nombre, 
usuarioApellido = p_apellido, 
usuarioFechaNacimiento = p_fechanac, 
usuarioGenero = p_genero, 
usuarioEmail = p_email,
usuarioContraseña = if(p_contraseña = '', @tempcontra, p_contraseña)
where usuarioId = p_id;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `userUpdateImg` (IN `p_id` INT, IN `p_img` MEDIUMBLOB)  begin
update Usuario set usuarioFotoPerfil = p_img where usuarioId = p_id;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `valoracionGet` (IN `p_cursoid` INT, OUT `p_valoracion` FLOAT)  begin
    set @tempval = (select SUM(comentarioCalificacion) from Comentarios where cursoId = p_cursoid) / (select COUNT(comentarioId) from Comentarios where cursoId = p_cursoid);
    select @tempval into p_valoracion;
end$$

